def solve_string(s):
    n = len(s)
    if n == 0:
        return True

    dp = [False] * (n + 1)
    dp[0] = True

    for i in range(1, n + 1):
        for j in range(i):
            if dp[j] and s[j:i] in s:
                dp[i] = True
                break

    return dp[n]

